vector<string> separate_paren_groups(string paren_string) {
    vector<string> groups;
    int balance = 0;
    string current_group = "";

    for (char c : paren_string) {
        if (c == ' ') continue; // Ignore spaces

        if (c == '(') {
            balance++;
            current_group += c;
        } else if (c == ')') {
            balance--;
            current_group += c;
            if (balance == 0) {
                groups.push_back(current_group);
                current_group = "";
            }
        }
    }

    return groups;
}

