vector<int> parse_music(string music_string) {
    vector<int> beats;
    size_t start = 0;
    size_t end = music_string.find(' ');

    while (end != string::npos) {
        string note = music_string.substr(start, end - start);
        if (note == "o") {
            beats.push_back(4);
        } else if (note == "o|") {
            beats.push_back(2);
        } else if (note == ".|") {
            beats.push_back(1);
        }
        start = end + 1;
        end = music_string.find(' ', start);
    }

    // Handle the last note
    string last_note = music_string.substr(start);
    if (last_note == "o") {
        beats.push_back(4);
    } else if (last_note == "o|") {
        beats.push_back(2);
    } else if (last_note == ".|") {
        beats.push_back(1);
    }

    return beats;
}

