int how_many_times(string str, string substring) {
    if (substring.empty()) return 0;

    int count = 0;
    size_t pos = 0;

    while ((pos = str.find(substring, pos)) != string::npos) {
        count++;
        pos++; // Move to the next character to allow overlapping matches
    }

    return count;
}

