using namespace std;

string sort_numbers(string numbers) {
    // Map of number words to their numeric values
    map<string, int> numberMap = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    // Split the input string into words
    stringstream ss(numbers);
    vector<string> words;
    string word;
    while (ss >> word) {
        words.push_back(word);
    }

    // Convert words to their numeric values
    vector<int> nums;
    for (const string& word : words) {
        nums.push_back(numberMap[word]);
    }

    // Sort the numeric values
    sort(nums.begin(), nums.end());

    // Convert the sorted numeric values back to words
    vector<string> sortedWords;
    for (int num : nums) {
        for (const auto& pair : numberMap) {
            if (pair.second == num) {
                sortedWords.push_back(pair.first);
                break;
            }
        }
    }

    // Join the sorted words back into a single string
    stringstream result;
    for (size_t i = 0; i < sortedWords.size(); ++i) {
        if (i > 0) {
            result << " ";
        }
        result << sortedWords[i];
    }

    return result.str();
}


