// Function to evaluate the polynomial
double poly(const vector<double>& xs, double x) {
    double sum = 0;
    for (size_t i = 0; i < xs.size(); ++i) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

// Function to evaluate the derivative of the polynomial
double poly_derivative(const vector<double>& xs, double x) {
    double sum = 0;
    for (size_t i = 1; i < xs.size(); ++i) {
        sum += i * xs[i] * pow(x, i - 1);
    }
    return sum;
}

// Function to find a zero of the polynomial using the Newton-Raphson method
double find_zero(const vector<double>& xs) {
    // Initial guess
    double x = 0.0;
    double epsilon = 1e-6; // Tolerance for convergence
    double max_iterations = 1000; // Maximum number of iterations

    for (int i = 0; i < max_iterations; ++i) {
        double f_x = poly(xs, x);
        double f_prime_x = poly_derivative(xs, x);

        // Check if the derivative is zero to avoid division by zero
        if (fabs(f_prime_x) < epsilon) {
            break;
        }

        // Update the guess using the Newton-Raphson formula
        double new_x = x - f_x / f_prime_x;

        // Check for convergence
        if (fabs(new_x - x) < epsilon) {
            return new_x;
        }

        x = new_x;
    }

    // If no convergence, return the best guess found
    return x;
}


#undef NDEBUG
#include<assert.h>
int main(){

    double solution;
    int ncoeff;
    for (int i=0;i<100;i++)
    {
        ncoeff = 2 * (1+rand()%4);
        vector<double> coeffs = {};
        for (int j=0;j<ncoeff;j++)
        {
            double coeff = -10+rand()%21;
            if (coeff == 0) coeff = 1;
            coeffs.push_back(coeff);
        }

        solution = find_zero(coeffs);
        assert (abs(poly(coeffs, solution))< 1e-3);
    }
}

