string circular_shift(int x, int shift) {
    string digits = to_string(x);
    int n = digits.length();
    shift %= n; // In case shift is greater than the number of digits
    if (shift == 0) {
        return digits;
    }
    // Perform the circular shift
    string shifted = digits.substr(n - shift) + digits.substr(0, n - shift);
    return shifted;
}

