bool will_it_fly(vector<int> q, int w) {
    // Check if the vector is a palindrome
    bool isBalanced = true;
    for (size_t i = 0; i < q.size() / 2; ++i) {
        if (q[i] != q[q.size() - 1 - i]) {
            isBalanced = false;
            break;
        }
    }

    // Calculate the sum of the elements
    int sum = accumulate(q.begin(), q.end(), 0);

    // Check if the object will fly
    return isBalanced && sum <= w;
}

