int search(vector<int> lst) {
    unordered_map<int, int> freqMap;

    // Count the frequency of each element
    for (int num : lst) {
        freqMap[num]++;
    }

    int result = -1;

    // Check for the greatest integer that meets the condition
    for (const auto& entry : freqMap) {
        if (entry.first > 0 && entry.second >= entry.first) {
            result = max(result, entry.first);
        }
    }

    return result;
}

