bool is_prime(int n) {
    if (n <= 1) return false;
    if (n <= 3) return true;
    if (n % 2 == 0 || n % 3 == 0) return false;
    for (int i = 5; i * i <= n; i += 6) {
        if (n % i == 0 || n % (i + 2) == 0) return false;
    }
    return true;
}

bool is_multiply_prime(int a) {
    if (a < 2) return false;
    vector<int> primes;
    for (int i = 2; i < 100; ++i) {
        if (is_prime(i)) {
            primes.push_back(i);
        }
    }

    for (int i : primes) {
        if (a % i == 0) {
            int quotient = a / i;
            for (int j : primes) {
                if (quotient % j == 0) {
                    int second_quotient = quotient / j;
                    for (int k : primes) {
                        if (second_quotient % k == 0 && second_quotient / k == 1) {
                            return true;
                        }
                    }
                }
            }
        }
    }
    return false;
}


