string anti_shuffle(string s) {
    // Lambda function to sort a word's characters
    auto sort_word = [](string& word) {
        sort(word.begin(), word.end());
    };

    // Variables to store the result and track the start of each word
    string result = "";
    int word_start = 0;

    // Iterate through the string
    for (int i = 0; i <= s.length(); ++i) {
        // Check if we reached the end of a word or the end of the string
        if (i == s.length() || s[i] == ' ') {
            // Sort the current word
            sort_word(s.substr(word_start, i - word_start));
            // Append the sorted word to the result
            result += s.substr(word_start, i - word_start);
            // If not at the end of the string, add a space
            if (i < s.length()) {
                result += ' ';
            }
            // Update the start of the next word
            word_start = i + 1;
        }
    }

    return result;
}

// Function to test the anti_shuffle function
void test_anti_shuffle() {
    cout << anti_shuffle("Hi") << endl; // Output: "Hi"
    cout << anti_shuffle("hello") << endl; // Output: "ehllo"
    cout << anti_shuffle("Hello World!!!") << endl; // Output: "Hello !!!Wdlor"
}


