int starts_one_ends(int n) {
    if (n == 1) {
        return 1; // Only one 1-digit number starts and ends with 1, which is 1 itself.
    }

    // For n > 1, we can calculate the count as follows:
    // - Numbers starting with 1: There are 10^(n-1) such numbers.
    // - Numbers ending with 1: There are 10^(n-1) such numbers.
    // - Numbers starting and ending with 1: There are 10^(n-2) such numbers (to avoid double-counting).

    long long total_start_with_1 = pow(10, n - 1);
    long long total_end_with_1 = pow(10, n - 1);
    long long total_start_and_end_with_1 = pow(10, n - 2);

    // Total count = (Numbers starting with 1) + (Numbers ending with 1) - (Numbers starting and ending with 1)
    return total_start_with_1 + total_end_with_1 - total_start_and_end_with_1;
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (starts_one_ends(1) == 1);
    assert (starts_one_ends(2) == 18);
    assert (starts_one_ends(3) == 180);
    assert (starts_one_ends(4) == 1800);
    assert (starts_one_ends(5) == 18000);
}

