string solve(int N) {
    // Step 1: Calculate the sum of the digits
    int sum = 0;
    while (N > 0) {
        sum += N % 10;
        N /= 10;
    }

    // Step 2: Convert the sum to binary
    string binary = "";
    if (sum == 0) {
        return "0";
    }
    while (sum > 0) {
        binary = to_string(sum % 2) + binary;
        sum /= 2;
    }

    // Step 3: Return the binary representation
    return binary;
}

// Function to test the solution
void test() {
    cout << solve(1000) << " (Expected: 1)" << endl;
    cout << solve(150) << " (Expected: 110)" << endl;
    cout << solve(147) << " (Expected: 1100)" << endl;
}


#undef NDEBUG
