string encrypt(string s) {
    string result = "";
    for (char c : s) {
        if (islower(c)) {
            // Shift lowercase letter by 4 positions
            result += 'a' + (c - 'a' + 4) % 26;
        } else if (isupper(c)) {
            // Shift uppercase letter by 4 positions
            result += 'A' + (c - 'A' + 4) % 26;
        } else {
            // Non-alphabetic characters remain unchanged
            result += c;
        }
    }
    return result;
}


