string encode(string message) {
    // Function to swap the case of a character
    auto swapCase = [](char c) -> char {
        if (islower(c)) return toupper(c);
        if (isupper(c)) return tolower(c);
        return c;
    };

    // Function to replace vowels with the letter 2 places ahead
    auto replaceVowel = [](char c) -> char {
        switch (tolower(c)) {
            case 'a': return 'C';
            case 'e': return 'G';
            case 'i': return 'K';
            case 'o': return 'Q';
            case 'u': return 'W';
            default: return c;
        }
    };

    // Encode the message
    for (char &c : message) {
        c = swapCase(c);
        c = replaceVowel(c);
    }

    return message;
}

