// Helper function to check if a number is prime
bool isPrime(int n) {
    if (n <= 1) return false;
    if (n == 2) return true;
    if (n % 2 == 0) return false;
    for (int i = 3; i * i <= n; i += 2) {
        if (n % i == 0) return false;
    }
    return true;
}

// Function to sum the digits of a number
int sumOfDigits(int n) {
    int sum = 0;
    while (n > 0) {
        sum += n % 10;
        n /= 10;
    }
    return sum;
}

// Main function to find the largest prime and return the sum of its digits
int skjkasdkd(vector<int> lst) {
    int largestPrime = -1;
    for (int num : lst) {
        if (isPrime(num) && num > largestPrime) {
            largestPrime = num;
        }
    }
    if (largestPrime == -1) {
        return 0; // No prime number found
    }
    return sumOfDigits(largestPrime);
}

