int closest_integer(string value) {
    // Convert the string to a floating-point number
    double num = stod(value);

    // Get the floor and ceiling values
    double floorValue = floor(num);
    double ceilValue = ceil(num);

    // Check if the number is equidistant from two integers
    if (num - floorValue == ceilValue - num) {
        // Round away from zero
        if (num > 0) {
            return static_cast<int>(ceilValue);
        } else {
            return static_cast<int>(floorValue);
        }
    } else {
        // Use standard rounding rules
        return static_cast<int>(round(num));
    }
}

