vector<int> make_a_pile(int n) {
    vector<int> pile;
    int current_stones = n;
    for (int i = 0; i < n; ++i) {
        pile.push_back(current_stones);
        if (n % 2 == 0) {
            // If n is even, the next number is the next even number
            current_stones += 2;
        } else {
            // If n is odd, the next number is the next odd number
            current_stones += 2;
        }
    }
    return pile;
}

