string rounded_avg(int n, int m) {
    if (n > m) {
        return "-1";
    }
    int sum = 0;
    for (int i = n; i <= m; ++i) {
        sum += i;
    }
    int count = m - n + 1;
    int average = sum / count;
    string binary = "";
    if (average == 0) {
        return "0";
    }
    while (average > 0) {
        binary = to_string(average % 2) + binary;
        average /= 2;
    }
    return binary;
}

