// Helper function to calculate factorial
int factorial(int num) {
    int result = 1;
    for (int i = 1; i <= num; ++i) {
        result *= i;
    }
    return result;
}

// Helper function to calculate the sum of numbers from 1 to num
int sumToN(int num) {
    return (num * (num + 1)) / 2;
}

vector<int> f(int n) {
    vector<int> result(n);
    for (int i = 1; i <= n; ++i) {
        if (i % 2 == 0) {
            result[i - 1] = factorial(i);
        } else {
            result[i - 1] = sumToN(i);
        }
    }
    return result;
}

