bool move_one_ball(vector<int> arr) {
    if (arr.empty()) {
        return true;
    }

    // Find the index where the array should start to be sorted
    int n = arr.size();
    int start_index = -1;
    for (int i = 0; i < n - 1; ++i) {
        if (arr[i] > arr[i + 1]) {
            if (start_index != -1) {
                // More than one place where the array is not sorted
                return false;
            }
            start_index = i + 1;
        }
    }

    // If the array is already sorted
    if (start_index == -1) {
        return true;
    }

    // Check if the array is sorted after the potential rotation
    for (int i = start_index; i < n - 1; ++i) {
        if (arr[i] > arr[i + 1]) {
            return false;
        }
    }

    // Check the wrap-around condition
    if (arr[n - 1] > arr[0]) {
        return false;
    }

    return true;
}

