    auto check = [](const string& test, const map<char, int>& expected) {
        map<char, int> result = histogram(test);
        if (result == expected) {
            cout << "Test passed" << endl;
        } else {
            cout << "Test failed" << endl;
        }
    };

    check("a b c", {{'a', 1}, {'b', 1}, {'c', 1}});
    check("a b b a", {{'a', 2}, {'b', 2}});
    check("a b c a b", {{'a', 2}, {'b', 2}});
    check("b b b b a", {{'b', 4}});
    check("", {});
}


