int max_fill(vector<vector<int>> grid, int capacity) {
    int total_buckets_needed = 0;
    for (const auto& row : grid) {
        int water_units = accumulate(row.begin(), row.end(), 0);
        total_buckets_needed += (water_units + capacity - 1) / capacity; // Ceiling division
    }
    return total_buckets_needed;
}

