string match_parens(vector<string> lst) {
    // Count the number of open and close parentheses in both strings
    int open1 = 0, close1 = 0;
    for (char c : lst[0]) {
        if (c == '(') open1++;
        else close1++;
    }

    int open2 = 0, close2 = 0;
    for (char c : lst[1]) {
        if (c == '(') open2++;
        else close2++;
    }

    // Check if concatenating in either order results in a balanced string
    if ((open1 >= close2 && open1 + open2 == close1 + close2) || (open2 >= close1 && open1 + open2 == close1 + close2)) {
        return "Yes";
    } else {
        return "No";
    }
}

