bool is_sorted(vector<int> lst) {
    if (lst.empty()) return true;

    int prev = lst[0];
    int count = 1;

    for (size_t i = 1; i < lst.size(); ++i) {
        if (lst[i] < prev) {
            return false; // Not in ascending order
        } else if (lst[i] == prev) {
            count++;
            if (count > 2) {
                return false; // Number appears more than twice
            }
        } else {
            prev = lst[i];
            count = 1;
        }
    }

    return true;
}

