bool isLeapYear(int year) {
    return (year % 4 == 0 && (year % 100 != 0 || year % 400 == 0));
}

bool valid_date(string date) {
    // Check if the date string is empty
    if (date.empty()) {
        return false;
    }

    // Check the format of the date string
    if (date.find('-') == string::npos || count(date.begin(), date.end(), '-') != 2) {
        return false;
    }

    // Parse the date string
    stringstream ss(date);
    string token;
    vector<int> parts;
    while (getline(ss, token, '-')) {
        if (token.empty()) {
            return false;
        }
        parts.push_back(stoi(token));
    }

    // Extract month, day, and year
    int month = parts[0];
    int day = parts[1];
    int year = parts[2];

    // Validate month
    if (month < 1 || month > 12) {
        return false;
    }

    // Validate day based on month
    if (day < 1) {
        return false;
    }
    if (month == 2) {
        if (isLeapYear(year)) {
            if (day > 29) {
                return false;
            }
        } else {
            if (day > 28) {
                return false;
            }
        }
    } else if (month == 4 || month == 6 || month == 9 || month == 11) {
        if (day > 30) {
            return false;
        }
    } else {
        if (day > 31) {
            return false;
        }
    }

    return true;
}

