int prod_signs(vector<int> arr) {
    if (arr.empty()) {
        return -32768;
    }

    int signProduct = 1;
    int magnitudeSum = 0;

    for (int num : arr) {
        if (num == 0) {
            signProduct = 0;
            break;
        }
        signProduct *= (num > 0) ? 1 : -1;
        magnitudeSum += abs(num);
    }

    return signProduct * magnitudeSum;
}

