// Define a structure for the priority queue
struct PathState {
    vector<int> path;
    int row, col;
    int length;
};

// Comparator for the priority queue to ensure lexicographical order
struct Compare {
    bool operator()(const PathState& a, const PathState& b) {
        for (int i = 0; i < min(a.path.size(), b.path.size()); ++i) {
            if (a.path[i] != b.path[i]) {
                return a.path[i] > b.path[i];
            }
        }
        return a.path.size() > b.path.size();
    }
};

vector<int> minPath(vector<vector<int>>& grid, int k) {
    int N = grid.size();
    priority_queue<PathState, vector<PathState>, Compare> pq;

    // Initialize the priority queue with all possible starting points
    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            pq.push({{grid[i][j]}, i, j, 1});
        }
    }

    // Directions for moving up, down, left, right
    vector<pair<int, int>> directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

    while (!pq.empty()) {
        auto [path, row, col, length] = pq.top();
        pq.pop();

        if (length == k) {
            return path;
        }

        for (auto& [dr, dc] : directions) {
            int newRow = row + dr;
            int newCol = col + dc;

            if (newRow >= 0 && newRow < N && newCol >= 0 && newCol < N) {
                vector<int> newPath = path;
                newPath.push_back(grid[newRow][newCol]);
                pq.push({newPath, newRow, newCol, length + 1});
            }
        }
    }

    return {}; // Should never reach here if input is valid
}


