        return memo[n] = 1 + n / 2;
    } else {
        return memo[n] = computeTri(n - 1, memo) + computeTri(n - 2, memo) + computeTri(n + 1, memo);
    }
}

// Function to generate the first n + 1 numbers of the Tribonacci sequence
vector<int> tri(int n) {
    vector<int> result(n + 1);
    unordered_map<int, int> memo;

    for (int i = 1; i <= n; ++i) {
        result[i] = computeTri(i, memo);
    }

    // Special case for tri(0)
    result[0] = 1;

    return result;
}

