bool is_nested(string str) {
    stack<char> s;
    bool nested = false;

    for (char c : str) {
        if (c == '[') {
            s.push(c);
        } else if (c == ']' && !s.empty()) {
            s.pop();
            // If the stack is not empty after popping, it means we have a nested structure
            if (!s.empty()) {
                nested = true;
            }
        }
    }

    return nested;
}

