bool is_equal_to_sum_even(int n) {
    // The smallest sum of 4 positive even numbers is 2 + 2 + 2 + 2 = 8
    // Any number less than 8 cannot be expressed as the sum of 4 positive even numbers
    if (n < 8) {
        return false;
    }
    // If n is greater than or equal to 8 and is even, it can always be expressed as the sum of 4 positive even numbers
    // This is because we can use 2 + 2 + 2 + (n - 6) where (n - 6) is also even
    return (n % 2 == 0);
}


