// Function to convert a string to a double, handling both '.' and ',' as decimal separators
double stringToDouble(const string& str) {
    string modifiedStr = str;
    size_t pos = modifiedStr.find(',');
    if (pos != string::npos) {
        modifiedStr[pos] = '.';
    }
    try {
        return stod(modifiedStr);
    } catch (const invalid_argument& e) {
        throw runtime_error("Invalid number format");
    }
}

// Function to compare two boost::any values
boost::any compare_one(boost::any a, boost::any b) {
    double valA, valB;

    // Convert a to double
    if (a.type() == typeid(int)) {
        valA = any_cast<int>(a);
    } else if (a.type() == typeid(double)) {
        valA = any_cast<double>(a);
    } else if (a.type() == typeid(string)) {
        valA = stringToDouble(any_cast<string>(a));
    } else {
        throw runtime_error("Unsupported type for a");
    }

    // Convert b to double
    if (b.type() == typeid(int)) {
        valB = any_cast<int>(b);
    } else if (b.type() == typeid(double)) {
        valB = any_cast<double>(b);
    } else if (b.type() == typeid(string)) {
        valB = stringToDouble(any_cast<string>(b));
    } else {
        throw runtime_error("Unsupported type for b");
    }

    // Compare the values
    if (valA == valB) {
        return "None";
    } else if (valA > valB) {
        return a;
    } else {
        return b;
    }
}


#undef NDEBUG
#include<assert.h>
int main(){
    assert (boost::any_cast<int>(compare_one(1, 2)) == 2);
    assert (boost::any_cast<double>(compare_one(1, 2.5))== 2.5);
    assert (boost::any_cast<int>(compare_one(2, 3)) == 3);
    assert (boost::any_cast<int>(compare_one(5, 6)) == 6);
    assert (boost::any_cast<string>(compare_one(1, string("2,3")))== "2,3");
    assert (boost::any_cast<string>(compare_one(string("5,1"), string("6"))) == "6");
    assert (boost::any_cast<string>(compare_one(string("1"), string("2"))) == "2");
    assert (boost::any_cast<string>(compare_one(string("1"), 1)) == "None");
}

