string fix_spaces(string text) {
    string result;
    int spaceCount = 0;

    for (char ch : text) {
        if (ch == ' ') {
            spaceCount++;
        } else {
            if (spaceCount > 2) {
                result += '-';
            } else if (spaceCount > 0) {
                result += string(spaceCount, '_');
            }
            spaceCount = 0;
            result += ch;
        }
    }

    if (spaceCount > 2) {
        result += '-';
    } else if (spaceCount > 0) {
        result += string(spaceCount, '_');
    }

    return result;
}

