// Function to parse a fraction string into numerator and denominator
pair<long long, long long> parseFraction(const string& fraction) {
    stringstream ss(fraction);
    string numeratorStr, denominatorStr;
    getline(ss, numeratorStr, '/');
    getline(ss, denominatorStr, '/');
    long long numerator = stoll(numeratorStr);
    long long denominator = stoll(denominatorStr);
    return {numerator, denominator};
}

// Function to simplify the product of two fractions
bool simplify(string x, string n) {
    // Parse the fractions
    auto [xNum, xDen] = parseFraction(x);
    auto [nNum, nDen] = parseFraction(n);

    // Multiply the fractions
    long long resultNumerator = xNum * nNum;
    long long resultDenominator = xDen * nDen;

    // Check if the result is a whole number
    return (resultNumerator % resultDenominator == 0);
}

// Function to test the simplify function
