int get_max_triples(int n) {
    // Create the vector a based on the given formula
    vector<int> a(n);
    for (int i = 1; i <= n; ++i) {
        a[i - 1] = i * i - i + 1;
    }

    // Count the number of valid triples (a[i], a[j], a[k]) where i < j < k
    int count = 0;
    for (int i = 0; i < n; ++i) {
        for (int j = i + 1; j < n; ++j) {
            for (int k = j + 1; k < n; ++k) {
                if ((a[i] + a[j] + a[k]) % 3 == 0) {
                    count++;
                }
            }
        }
    }

    return count;
}

