// Function to calculate the sum of digits of a number
int sum_of_digits(int n) {
    int sum = 0;
    bool isNegative = n < 0;
    while (n != 0) {
        int digit = n % 10;
        if (isNegative && n < 0) {
            digit = -digit;
        }
        sum += digit;
        n /= 10;
    }
    return sum;
}

// Comparator function to sort based on the sum of digits
bool compare(int a, int b) {
    int sumA = sum_of_digits(a);
    int sumB = sum_of_digits(b);
    if (sumA == sumB) {
        return a < b; // Maintain original order if sums are equal
    }
    return sumA < sumB;
}

