        // Check if the number is non-negative and an integer
        if (num >= 0 && floor(num) == num) {
            int intNum = static_cast<int>(num);
            // Check if the number is odd
            if (intNum % 2 != 0) {
                sum += intNum * intNum;
            }
        }
    }
    return sum;
}

