bool cycpattern_check(string a, string b) {
    if (b.length() > a.length()) {
        return false;
    }

    string concatenated = a + a; // Concatenate the string with itself
    for (size_t i = 0; i < b.length(); ++i) {
        string rotated = b.substr(i) + b.substr(0, i); // Generate all rotations of b
        if (concatenated.find(rotated) != string::npos) {
            return true;
        }
    }
    return false;
}

