using namespace std;

string find_max(vector<string> words) {
    string maxWord = "";
    int maxUniqueChars = 0;

    for (const string& word : words) {
        set<char> uniqueChars(word.begin(), word.end());
        int numUniqueChars = uniqueChars.size();

        if (numUniqueChars > maxUniqueChars || (numUniqueChars == maxUniqueChars && word < maxWord)) {
            maxUniqueChars = numUniqueChars;
            maxWord = word;
        }
    }

    return maxWord;
}

