using namespace std;

string solve(string s) {
    bool hasLetters = false;
    for (char& c : s) {
        if (isalpha(c)) {
            hasLetters = true;
            if (islower(c)) {
                c = toupper(c);
            } else {
                c = tolower(c);
            }
        }
    }
    if (!hasLetters) {
        reverse(s.begin(), s.end());
    }
    return s;
}


