using namespace std;

vector<int> generate_integers(int a, int b) {
    // Ensure a is less than or equal to b
    if (a > b) {
        swap(a, b);
    }

    vector<int> evenDigits = {2, 4, 6, 8};
    vector<int> result;

    // Iterate through the even digits and add those within the range [a, b]
    for (int digit : evenDigits) {
        if (digit >= a && digit <= b) {
            result.push_back(digit);
        }
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
bool issame(vector<int> a,vector<int>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
    if (a[i]!=b[i]) return false;
    }
    return true;
}
int main(){
    assert (issame(generate_integers(2, 10) , {2, 4, 6, 8}));
    assert (issame(generate_integers(10, 2) , {2, 4, 6, 8}));
    assert (issame(generate_integers(132, 2) , {2, 4, 6, 8}));
    assert (issame(generate_integers(17,89) , {}));
}

